import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import WebFooter from './web_footer/web_footer';
import Navbar from './navbar/navbar'
import Project from './project_tab/project_tab';
import Intro from './introduction/introduction';
import ItemCard from './itemcard/itemcard'


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Navbar />
    <Intro />
    {/* <Project /> */}
    <ItemCard src= '.\images\machine-learning.jpg' title="test name!" desc="Built a fake file system, written in C, which works similar to the real extended file system (EXT1) from Linux.
\item Displayed the available and used data with bitmaps with the ability to add/remove them accordingly."flip="" />
    <WebFooter />




  </React.StrictMode>
);
